import React from 'react';
import {Container, ImageOne, TextTitle, BoxImage, ProgressBar, NumberProgressBar} from './style.js';
import brainwave from '../../assets/brainwave.svg';
import illustrationfr from '../../assets/illustrationfr.svg';
import floatBackground from '../../assets/floatBackground.svg';

function LandingPage() {
  return (
    <Container>
      <ImageOne>
        <img src={brainwave} alt="brainwave"/>
      </ImageOne>
      <TextTitle>
        <span className="textshadow">What We Do</span>
        <div/>
      </TextTitle>
      <BoxImage>
        <img src={illustrationfr} alt="illustrationfr"/>
        <span>1</span>
      </BoxImage>
      <ProgressBar>
        <div/>
      </ProgressBar>
      <NumberProgressBar>
        <span>1/15</span>
      </NumberProgressBar>
    </Container>
  );
}

export default LandingPage;
